import React from "react"

import activeBrandFolderIcon from '../../assets/images/active-brand-icon.png';
import brandFolderIcon from '../../assets/images/brand-icon.png';
import gearIcon from '../../assets/images/gear.png'
import { useEffect, useState } from 'react';
import { GeneralServices } from "../../jwt/_services/General.services";
import { FormDataHelper } from "../../jwt/_helpers/FormDataHelper";
import { BRANDS_LISTING } from "../../jwt/_services/axiousURL";

const BrandsListing = () => {

    const [brands, setBrands] = useState([]);

    useEffect(() => {

        fetchBrands();

    }, []);

    const fetchBrands = () => {

        var bodyHelper = FormDataHelper();
        GeneralServices.postRequest(bodyHelper, BRANDS_LISTING).then(
            () => { },
            () => { }
        );
    };

    return <>
        <div className="brandListing-page">
            <section class="blp">
                <main class="cont">
                    <div class="pageHead">
                        <h1>Brands</h1>
                        <button>+ Create brand</button>
                    </div>
                    <div class="brandsBody">
                        <h4>Brands <span>(2)</span></h4>
                        <div class="brandsList">
                            <div class="brandsList_single">
                                <div class="brandsList_head">
                                    <div class="brandsList_left">
                                        <img src={brandFolderIcon} alt="brand-icon" />
                                        <h3>Xiotic Labs</h3>
                                    </div>
                                    <button>
                                        <img src={gearIcon} alt="gear" />
                                        <span>Options</span>
                                    </button>
                                </div>
                                <p class="brandsList-p">Used in 2 projects</p>
                            </div>
                            <div class="brandsList_single">
                                <div class="brandsList_head">
                                    <div class="brandsList_left">
                                        <img src={activeBrandFolderIcon} alt="brand-icon" />
                                        <h3>Dragon Bal...</h3>
                                    </div>
                                    <button>
                                        <img src={gearIcon} alt="gear" />
                                        <span>Options</span>
                                    </button>
                                </div>
                                <p class="brandsList-p">Used in 2 projects</p>
                            </div>
                        </div>
                    </div>
                </main>
            </section>
        </div>
    </>
}

export default BrandsListing
